syntax = "proto3";


option java_multiple_files = true;
option java_package = "com.shadow.codecoverage.protoc.report";



message SanCoverData{

  //类名称
  string class_name = 1;

  //类名称
  string method_name = 2;

  //类名称
  string method_key = 3;

  //类名称
  string jar_name = 4;

  //类名称
  int32 parent_id = 5;

  //类名称
  int32 span_id = 6;

  //类名称
  repeated string cover_lines = 7;
}